// frontend/src/components/Layout/Menu.js

import React from 'react';
import { Link } from 'react-router-dom';
import './Menu.css'; // Ajusta la ruta del CSS si es necesario

const Menu = () => {
  return (
    <div className="menu">
      <h1>Menu Principal</h1>
      <nav>
        <ul>
          <li>
            <Link to="/documents">Documentos</Link>
          </li>
          <li>
            <Link to="/transactions">Transacciones</Link>
          </li>
          {/* Otros enlaces del men√∫ */}
        </ul>
      </nav>
    </div>
  );
};

export default Menu;
